import React from 'react';

const RegionNN = ({ data, onEdit }) => {
  const regionData = data.filter(item => item.region === 'NN');

  return (
    <div>
      <h2>Region NN</h2>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Temperature</th>
            <th>Pressure</th>
            <th>Humidity</th>
            <th>Edit</th>
          </tr>
        </thead>
        <tbody>
          {regionData.map(item => (
            <tr key={item.id}>
              <td>{item.id}</td>
              <td>{item.temperature}</td>
              <td>{item.pressure}</td>
              <td>{item.humidity}</td>
              <td><button onClick={() => onEdit(item)}>Edit</button></td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default RegionNN;
